/*Table structure for table `tbl_product_master` */

DROP TABLE IF EXISTS `tbl_product_master`;

CREATE TABLE `tbl_product_master` (
  `productid` bigint(20) NOT NULL,
  `product_code` varchar(45) DEFAULT NULL,
  `vendorid` int(10) DEFAULT NULL,
  `vendor_prd_code` varchar(45) DEFAULT NULL COMMENT 'Vendor given product code to the jzeva product inventory',
  `leadTime` varchar(100) NOT NULL DEFAULT '' COMMENT 'Delivery Tead Time',
  `returneligible` varchar(5) DEFAULT 'No' COMMENT 'Is jewellery a 7 day return eligible',
  `productDescription` text COMMENT 'description of the product',
